const PopupCheckout = () => {
	return (
		<PopupCheckoutContainer> 
			<TableContainer>
				<PayContainer>
					<h2>Pay In Ethereum</h2>	

				</PayContainer>
			</TableContainer>
		</PopupCheckoutContainer>
	)
}

export default PopupCheckout;
